import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Cards';
import './index.css';
import Sdata from './Sdata'


function ncard(val){
    return(
        <Card 
        sname = {val.sname}
        imgsrc = {val.imgsrc}
        title =  {val.title}
        link = {val.link}
        />
    );
}


ReactDOM.render(
    <div>
    <h1 class="heading_style">List of Netflix Series 2021</h1>

   
    
    Sdata.map(ncard);

    </div>,
    document.getElementById("root")
);
